function toExpression(targetId) {
	var oEBox = document.getElementById(targetId);
	var oUl = oEBox.getElementsByTagName('ul')[0];
	for (var i = 0; i < 29; i++) {
		var oLi = document.createElement('li');
		var oImg = document.createElement('img');
		var src = expr_lib_obj['smiley_' + (i + 1)];
		toShowPic(oImg, src);
		oLi.appendChild(oImg);
		oUl.appendChild(oLi);
	}
	return this;
}
 
 function replace_em(str) {
		str = str.replace(/\</g, '&lt;');
		str = str.replace(/\>/g, '&gt;');
		str = str.replace(/\n/g, '<br/>');
		str = str.replace(/\[s([0-9]*)\]/g, function(word) {
			var hm = '<img src="'+expr_lib_obj['smiley_'+word.replace(/[^0-9]/ig,"")]+'" border="0" />';
			return hm;
		});
		return str;
	}

        
        function toShowPic(oimg,path){
            var imgpath=oimg.getAttribute('src');
            oimg.setAttribute('src',path);
        }


        function showHide(id,targetId){
            var o=document.getElementById(id);
            var t=document.getElementById(targetId)

            o.onclick=function (ev){
					var event=ev||window.event;
					event.cancelBubble=true;	//阻止冒泡
                 if (t.style.display=='block') { 
					t.style.display='none'; 
                 }else {
                     t.style.display='block'
                 }
                //t.style.display=='block' ? t.style.display='none' : t.style.display='block';
				document.onclick=function(){
					t.style.display='none';
				}
            }

			return this;
        }
		
    	function sendFace(a,b){
			var oEBox=document.getElementById(b);
			var aLi=oEBox.getElementsByTagName('li');
			var aImg=document.getElementsByTagName('img');
			var placeHold=document.getElementById(a);

			for (var i=0;i<aLi.length;i++){
				aLi[i].index =i+1;
				aLi[i].onclick=function(){
					//var oImg=document.createElement('img');
					//var path=this.getElementsByTagName('img')[0].src;
					//oImg.setAttribute('src',path);
					//placeHold.appendChild(oImg);	
					var text=$(placeHold).html();
					text=text.replace('\n','');
					$(placeHold).html(text+"[s"+this.index+"]");
				}
			}	
			return this;	
		}
